import json
import logging
from datetime import datetime
from enum import Enum
from typing import Dict, List, Optional

# Set up logging
logging.basicConfig(level=logging.INFO)
logger = logging.getLogger("FABS_System")

class SubmissionStatus(Enum):
    DRAFT = "Draft"
    VALIDATED = "Validated"
    PROCESSING = "Processing"
    PUBLISHED = "Published"
    ERROR = "Error"

class FABSSubmission:
    def __init__(self, agency_name: str, submitter_id: str):
        self.submission_id = self._generate_id()
        self.agency_name = agency_name
        self.submitter_id = submitter_id
        self.status = SubmissionStatus.DRAFT
        self.flexfields = {}
        self.created_at = datetime.now()
        self.updated_at = datetime.now()
        logger.info(f"New FABS submission created: {self.submission_id}")

    def _generate_id(self) -> str:
        return f"FABS-{datetime.now().strftime('%Y%m%d%H%M%S')}"

    def update_status(self, new_status: SubmissionStatus) -> bool:
        self.status = new_status
        self.updated_at = datetime.now()
        logger.info(f"Submission {self.submission_id} status updated to {new_status.value}")
        return True

    def validate_flexfields(self) -> bool:
        required_fields = ["agency_code", "fiscal_year", "contact_email"]
        for field in required_fields:
            if field not in self.flexfields or not self.flexfields[field]:
                logger.warning(f"Validation failed for {self.submission_id}: Missing {field}")
                return False
        logger.info(f"Flexfields validated for {self.submission_id}")
        return True

